import React from 'react';
import styled from 'styled-components';
export const NavbarWrapper= styled.div`
      padding:0;
      margin: 0;
      background-color:  #333;
      color: black;
      li{
            display: inline;
            text-decoration:none;
            padding : 10px;
            float: right;
            
      }

`;
